import ReactDOM from 'react-dom/client'; // or 'react-dom' for older versions
import App from './App';
import './index.css'; // optional, your styles

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
      <App />
  </React.StrictMode>
);
